                <section class="healthcare-applications padding-b">
                    <div class="container">
                        <div class="healthcare-applications__content text-center">
                            <h2>INTELLECTSOFT ENGAGEMENT MODELS</h2>
                            <p>
                                Whether you need to extend your in-house team, build specific tech expertise, or speed up
                                software product development, you can do it faster and more effectively through our
                                engagement models.
                            </p>
                        </div>
                        <ul class="competencies__list new-competencies-list">
                            <li class="hover panel">
                                <div class="front">
                                    <div class="box1">
                                        <img src="/assets/d4869f7f/img/3.svg" alt>
                                        <div class="title">Dedicated Team</div>
                                    </div>
                                </div>
                                <div class="back">
                                    <div class="box2">
                                        <div class="competencies__list--content">
                                            <p>
                                                Our dedicated team business model is specifically designed to provide
                                                clients with Intellectsoft’s best-in-class software development
                                                professionals and experts on a long-term basis.
                                            </p>
                                        </div>
                                    </div>
                                </div>
                            </li>
                            <li class="hover panel">
                                <div class="front">
                                    <div class="box1">
                                        <img src="/assets/d4869f7f/img/4.svg" alt>
                                        <div class="title">Team Extension</div>
                                    </div>
                                </div>
                                <div class="back">
                                    <div class="box2">
                                        <div class="competencies__list--content">
                                            <p>
                                                The Team Extension model is intended to find a highly-skilled software
                                                development team with the right expertise and culture fit required for a
                                                specific software development project.
                                            </p>
                                        </div>
                                    </div>
                                </div>
                            </li>
                            <li class="hover panel">
                                <div class="front">
                                    <div class="box1">
                                        <img src="/assets/d4869f7f/img/2.svg" alt>
                                        <div class="title">Project-Based Model</div>
                                    </div>
                                </div>
                                <div class="back">
                                    <div class="box2">
                                        <div class="competencies__list--content">
